import React, { useState } from "react";
import css from "./Frame.module.css";

const Frame = ({ bgColor, onSelectColor, selected }) => {
  return (
    <div
      className={selected ? `${css.container} ${css.selected}` : css.container}
      style={{ backgroundColor: bgColor }}
      onClick={onSelectColor} // Directly use onSelectColor passed from parent
    >
      {selected && <div className={styles.selected}>Selected</div>}
    </div>
  );
};

export default Frame;
